import React from "react";
import axios from "axios";
import { useEffect, useState } from "react";
const Payload = () => {
  const [data, setData] = useState([]);
  const fetchData = () => {
    axios
      .get("https://api.spacexdata.com/v4/payloads")
      .then((res) => {
        console.log(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  };
  useEffect(() => {
    fetchData();
  }, []);
  return <div></div>;
};

export default Payload;
